import react from 'react';
import {Container, Row, Col, Bottom} from 'reactstrap';
import {Link} from 'react-router-dom';

const ThankYou = () => {
    return <section>
        <Container>
            <Row>
                <Col lg='12' className='text-center'>
                    <h1 className='mb-4'>Thank You!</h1>
                    <p className='mb-4'>Your booking has been successfully completed.</p>
                    <Link to='/tours' className='btn btn-primary'>Explore More Tours</Link>
                </Col>
            </Row>
        </Container>
        <Bottom className='text-center mt-5'>
            <p>&copy; {new Date().getFullYear()} Tour Management. All rights reserved.</p>
        </Bottom>
    </section>
};

export default ThankYou;
